import PropTypes from 'prop-types';
function Book(book){

    console.log(book);
    return(
        <table>
            <tr draggable="true" onClick={list}>
                <td>{bookParams.title}</td>
            </tr>
        </table>
        // <h2>this is a book</h2>
    )
}
Book.propTypes={
    title: PropTypes.string,
    author: PropTypes.string,
    isbn: PropTypes.number,
    year: PropTypes.string
}
export default Book;
